@Humanityisall Dude I do protein folding for citizen science and currently working on a protein cure for COVID19 using Foldit. 

 Its amazingly simple and yet frustrating, 80% of what I do is automated. 

 Human brains are more suited for creative tasks like protein folding, AI cant do as well

@KazRockchick I can tell you why? It?s all about the announcement, rather than the follow-up. 

 I welcomed the Koala census she was spruiking. Then read about the intended use of ?citizen science?. 

 It may be well-intentioned, but it?s flawed. I question the accuracy of the potential results.

